        },
        // 设置区域
        presetArea(provinceCodeIn, cityCodeIn, regionCodeIn) {
            console.log('gege',this.sync_value)
            const {
                provinceCode,
                cityCode,
                regionCode
            } = this.sync_value
            this.cities = []
            this.province = provinceCodeIn || provinceCode
            this.changeProvince(provinceCode)
            // 不需要城市
            if (!this.showCity) return
            this.city = cityCodeIn || cityCode
            this.changeCity(cityCode)

            // 不需要区县
            if (!this.showRegion) return
            this.region = regionCodeIn || regionCode
            this.changeRegion(regionCode)
        },
        // 获取当前结果
        getAreaRes() {
            const res = {
                provinceCode: this.province,
                provinceName: this.provinceName,
                cityCode: this.city,
                cityName: this.cityName,
                regionCode: this.region,
                regionName: this.regionName
            }
            this.sync_value = res;

            return res
        },
        // 修改省份
        changeProvince(value) {
            // console.log('value',value)
            if (!this.hasLoadProvince) {
                return
            }
            if (value !== '') {
                this.city = null
                this.loadingCity = true
                for (const item of this.provinces) {
                    if (item.ReginNum == value) {
                        this.provinceName = item.ReginName
                        this.hasLoadCities = true
                        this.cities = item.SubLst
                        this.loadingCity = false
                        break
                    } else {
                        continue
                    }
                }
            } else {
                this.cities = []
                this.cityName = null;
                this.city = null;
                this.regionName = null;
                this.region = null;
                this.provinceName = null;
            }
            if (this.showRegion) {
                this.region = null
            }
            this.$emit('change', this.getAreaRes())

        },
        // 修改城市
        changeCity(value) {
            // 加载区县
            if (!this.hasLoadCities) {
                return
            }
            if (value !== '') {
                this.region = null
                for (const item of this.cities) {
                    if (item.ReginNum != value) continue
                    this.cityName = item.ReginName
                    if (this.showRegion) {
                        this.regions = item.SubLst
                    }
                    break
                }
            } else {
                this.regions = []
                this.regionName = null;
                this.region = null;
                this.cityName = null;
            }
            this.$emit('change', this.getAreaRes())
        },
        // 修改区县
        changeRegion(value) {
            for (const item of this.regions) {
                if (item.ReginNum == value) {
                    this.regionName = item.ReginName
                    break
                } else {
                    continue
                }
            }

            if (value == '') {
                this.regionName = null;
            }
            this.$emit('change', this.getAreaRes())
        }
    }

